mapper.select:
select 

from mdzsj
where FRDM_U = #{FRDM_U,jdbcType=VARCHAR}
  and HTRQ_U = #{HTRQ_U,jdbcType=DATE}
  and HTLS_U = #{HTLS_U,jdbcType=VARCHAR}

mapper.delete:
delete from mdzsj
where FRDM_U = #{FRDM_U,jdbcType=VARCHAR}
  and HTRQ_U = #{HTRQ_U,jdbcType=DATE}
  and HTLS_U = #{HTLS_U,jdbcType=VARCHAR}
